// JavaScript source code
const myImage = new Image();
myImage.src = 'data:image/png;base64,';


myImage.addEventListener('load', function () {
    const canvas = document.getElementById('canvas1');
    const ctx = canvas.getContext('2d');
    canvas.height = 654;
    canvas.width = 600;

    ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);

    //create let array variable set to empty array
    let particleArray = [];

    //create const variable to store number of particles
    const numberOfParticles = 5000;

    class Particle
    {
        constructor()
        {
            //this will make particles to splash over the image
            this.x = Math.random() * canvas.width;
            this.y = 0;
            this.speed = 0; //will make particles to splash over black area fast & light area slow
            this.velocity = Math.random() * 3.5;
            this.size = Math.random() * 1.5 + 1;
        }

        update() 
        {
            this.y += this.velocity;
            if(this.y >= canvas.height)
            {
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
        }
        draw() {
            ctx.beginPath();
            ctx.fillStyle = 'white';

            //this line draws circle particles sizes
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.fill();
        }
    }
    function init()
    {
        for (let i = 0; i < numberOfParticles; i++)
        {
            particleArray.push(new Particle);
        }
    }
    init();
    function animate()
    {
        //placing this 'drawImage' method here, lets us see the image even when paritcles are falling
        ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
        ctx.globalAlpha = 0.05;
        ctx.fillStyle = 'rgb(0, 0, 0)'; //

        //drawing a rectangle of particles to fill entire canvas
        ctx.fillRect(0, 0, canvas.width, canvas.height);
        for(let i = 0; i < particleArray.length; i++)
        {
            particleArray[i].update();
            particleArray[i].draw();
        }
        requestAnimationFrame(animate);
    }
    //calling animate to kick off animation loop
    animate();
});